    <div>
      <div className='container'>
       <h2 className='text-center'>My Bookings</h2>
       <div className='side-by-side'>
        <button className='btn btn-warning' onClick={()=>getTripsCompleted()}>Trip Completed</button>
        <div className='p-3'></div>
        <button className='btn btn-warning' onClick={()=>getTripsOn}>Trips on Live</button>
        <div className='p-3'></div>
        <button className='btn btn-warning'>Upcoming trips</button>
       </div>
      </div>
    </div>
  )
}

export default MyBookings
